import React from "react";
class Slave extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      level: 0,
    };
  };

  render() {
    const level = this.state.level;
  return (
    <div> <p>{ level }</p></div> 
  );
};
};
export default Slave;
